import CustomButton from "../custom-buttons/custom-button.component";

import {PopupCheckoutContainer, TableContainer, PayContainer} from "./popup-checkout.styles"


const PopupCheckout = () => {
	return (
		<PopupCheckoutContainer> 
			<TableContainer>
				<PayContainer>
					<h2>Pay In Ethereum 0.02 ETH</h2>	
					<CustomButton> Pay </CustomButton>
				</PayContainer>
			</TableContainer>
		</PopupCheckoutContainer>
	)
}

export default PopupCheckout;
